import React from 'react';
import Cards from './Cards';


function App() {
    return (
        <>
            <div className='container'>
            <Cards imgsrc = 'images/sex_ed.jpg' title = 'A Netflix Original Series' 
            sname = 'Sex Education' slink = 'https://www.netflix.com/in/title/80197526' ></Cards>
            
            </div>
        </>
    );
}



export default App;
